import React from 'react';
import styled from 'styled-components';
import Header from './Header';
import CarDisplay from './CarDisplay';
import './App.css';

const AppContainer = styled.div`
  text-align: center;
`;

function App() {
  return (
    <AppContainer>
      <Header />
      <CarDisplay />
    </AppContainer>
  );
}

export default App;
